import React from "react";
import {
  Box,
  TextField,
  InputAdornment,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import data from "../data.json";

const Home = () => {
  return (
    <Box>
      <TextField
        type="text"
        name="search"
        //   onChange={HandleChange}
        InputProps={{
          startAdornment: (
            <InputAdornment
              position="start"
              // onClick={handleClickShowPassword}
            >
              <SearchIcon />
            </InputAdornment>
          ),
        }}
        placeholder="Enter password"
      />
      <Box sx={{ minWidth: 120 }}>
        <FormControl fullWidth>
          <InputLabel id="demo-simple-select-label">Country</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            //   value={age}
            label="country"
            //   onChange={handleChange}
          >
            <MenuItem value={10}>{data?.map((value, index) => ({}))}</MenuItem>
          </Select>
        </FormControl>
      </Box>
    </Box>
  );
};

export default Home;
